import React from 'react'

const SignIn = () => {
    //const [username, setUser] = useState('');
    return (
        <div style={{
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center',
            height: '100vh',
            flexDirection: 'column'
        }}>
            <input
                type="text"
                placeholder="username"
                style={inputStyle}
            />
            <div style={{ margin: '10px 0' }}>
                <input
                    type="password"
                    placeholder="password"
                    style={inputStyle}
                />
            </div>
        </div>
    );
};

const inputStyle = {
    width: '300px',
    padding: '10px',
    fontSize: '16px',
    borderRadius: '5px',
    border: '1px solid #ccc'
};


export default SignIn;
